const Header = () => {
  return (
    <div>
      <div>
        <div>
          <div>
            <h3>
              Money: <span>273.749 kr.</span>
            </h3>
          </div>
          <div>
            <h3>
              Next Plan: <span>3 days left</span>
            </h3>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
